import React, { useState, useEffect } from 'react';
import logo from './imgs/grey_logo.png';
import './App.css';
import axios from 'axios';

function App() {

  const [searchQuery, setSearchQuery] = useState('');
  const [tokenList, setTokenList] = useState([]);
  const [numTokens, setNumTokens] = useState(0);
  const [currentTime, setCurrentTime] = useState(0);

  useEffect(() => {
    fetch('/time').then(res => res.json()).then(data => {
      setCurrentTime(data.time);
    });
  }, []);

  const handleKeyPress = async (event) => {
    if (event.key === 'Enter') {
      try {
        const response = await axios.post('http://localhost:5000/api/predict', { input_string: searchQuery });
        const { tokens, num_tokens } = response.data;
        setTokenList(tokens);
        setNumTokens(num_tokens);
      } catch (error) {
        console.error('Error sending search query:', error);
      }
    }
  };

  const handleChange = (event) => {
    setSearchQuery(event.target.value);
  };

  return (
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
      <div className="instructions">
        <p>Run out of study material?</p>
        <p>Type a math, chemistry, or physics homework problem below and we'll give you some more!</p>
        <p>The current time is {currentTime}.</p>
      </div>
      <div className="searchBar">
        <input
          id="searchQueryInput"
          type="text"
          name="searchQueryInput"
          placeholder="Type a problem and hit Enter!"
          value={searchQuery}
          onChange={handleChange}
          onKeyPress={handleKeyPress}
        />
      </div>
      <div className="result-container">
        <p>Number of tokens: {numTokens}</p>
        <ul>
          {tokenList.map((token, index) => (
            <div className='result-card'> 
              <li key={index}>{token.token}</li>
            </div>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default App;
